Indie Game Magazines. Issues 1-13 Complete.


The Indie Game Magazine is an independently owned, developer-centric, 
video game magazine. Indie Game Mag, reviews and reports news on indie 
and casual games only! To our knowledge, we are the only exclusively 
indie game magazine available...so we have that going for us. 

What are indie games? 

Indie games are video games made by only a hand full of people, 
as opposed to the massive teams that make up the largest game studios. 
Indie Games are typically published by the people that make them or 
by some other small casual portal or distributor.


